script: |
  super -f text -I q9550.spq | sort > q9550.out

inputs:
  - name: q9550.spq
    data: |
      SELECT ALL col1 * + - col0 + - col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( - 81 / - col1 + - 30 * + - col2 IS NULL );
  - name: tab0

outputs:
  - name: q9550.out
    data: |
      -1296
      -1848
      -98
